import React from 'react'
import { useEffect , useState} from "react";
import axios from "axios";

function home() {
  const [test, setTest] = useState();

  useEffect(()=>{
    axios.get("http://localhost:3001/patient").then((response)=>{
      setTest(response.data);
    })
  },[])
  
  return (
    <div>
        {test}
    </div>
  )
}

export default home
